def __getTypes(pokemon):
    #with open("PokedexBox\\txtFiles\\damageRelations.txt", "r") as dmgRela:
    return nameToType[pokemon]["type"]

#########################
# defensive stats below #
#########################

def __getWeaknesses(type):
    return dmgRela[type]['double_damage_from']

def __getResistances(type):
    return dmgRela[type]['half_damage_from']

def __addWeakness(newWeaknesses, weak, fourWeak):
    # add each weakness
    for w in newWeaknesses:
        if w in weak:
            weak.remove(w)
            fourWeak.append(w)
        else:
            weak.append(w)

def __addResistances(newRes, res, fourRes):
    # add each weakness
    for r in newRes:
        if r in res:
            res.remove(r)
            fourRes.append(r)
        else:
            res.append(r)

def calculateWeaknesses(pokemon):
    pTypes = __getTypes(pokemon)
    
    weakness = []
    fourWeakness = []
    for t in pTypes:
        __addWeakness(__getWeaknesses(t),weakness,fourWeakness)
    res = [weakness,fourWeakness]
    return res

def getTeamWeaknesses(pokemonTeam:list):
    weaknesses = {}
    for k,_ in dmgRela.items():
        weaknesses.update({k: {"double": 0, "quad": 0}})

    for pokemon in pokemonTeam:
        pWeakness = calculateWeaknesses(pokemon)
        # add 2x weaknesses
        for w in pWeakness[0]:
            weaknesses[w]["double"] = weaknesses[w]["double"]+1
        # add 4x weaknesses
        for w in pWeakness[1]:
            weaknesses[w]["quad"] = weaknesses[w]["quad"]+1
    return weaknesses

def calculateResistances(pokemon):
    pTypes = __getTypes(pokemon)
    
    res = []
    fourRes = []
    for t in pTypes:
        __addResistances(__getResistances(t),res,fourRes)
    result = [res,fourRes]
    return result

def getTeamResistances(pokemonTeam):
    res = {}
    for k,_ in dmgRela.items():
        res.update({k: {"half": 0, "quart": 0}})

    for pokemon in pokemonTeam:
        pRes = calculateResistances(pokemon)
        # add 2x res
        for r in pRes[0]:
            res[r]["half"] = res[r]["half"]+1
        # add 4x res
        for r in pRes[1]:
            res[r]["quart"] = res[r]["quart"]+1
    return res

# calculates a score on the defensive site of pokemon (by type)
def calculateDefScoreByType(weak, res):
    # res keeps a score which represents the teams ability to defend against each type
    result = {}
    for k,_ in dmgRela.items():
        result.update({k: {"defScore": 0}})

    for pType in res:
        score = 0
        # reduce rating if player is weak to type
        score -= 2 * weak[pType]["double"]
        score -= 8 * weak[pType]["quad"]
        # increase if player resists type (higher value, since the trainer can switch out into a resisting pokemon)
        score += 3 * res[pType]["half"]
        score += 12 * res[pType]["quart"]

        result[pType] = score
    
    return result

# calculates one score to represent the defensive coverage
def calculateTotalDefScore(scoresByType):
    result = 0
    for pType in scoresByType:
        if scoresByType[pType] <= 0:
            result += scoresByType[pType]*1.5
        else:
            # squish positives effects down, since resistances are nice to have, no weaknesses in mandatory
            result += math.log(scoresByType[pType],2)   
    return result

