def __getEffectiveOn(type):
    return dmgRela[type]['double_damage_to']

def __getNotEffectiveOn(type):
    return dmgRela[type]['half_damage_to']

def __addEffectiveOn(newEffOn, effOn):
    # add each weakness
    for e in newEffOn:
        effOn.append(e)

def __addNotEffOn(newNot, notEffOn):
    # add each weakness
    for n in newNot:
        notEffOn.append(n)

def calculateEffOn(pokemon):
    pTypes = __getTypes(pokemon)
    
    effOn = []
    fourEffOn = []
    for t in pTypes:
        __addEffectiveOn(__getEffectiveOn(t),effOn)
    res = [effOn,fourEffOn]
    return res

def getTeamEffOn(pokemonTeam:list):
    effOn = {}
    for k,_ in dmgRela.items():
        effOn.update({k: {"double": 0}})

    for pokemon in pokemonTeam:
        pEffOn = calculateEffOn(pokemon)
        # add 2x weaknesses
        for e in pEffOn[0]:
            effOn[e]["double"] = effOn[e]["double"]+1
    return effOn
